import { GetTaskType } from "../Type";


export const GettaskListReducer = (state = [{TaskId: "", Task: '', Date: '', EditDate: '', Complete: "", UserId: ""}] , action) => {
    switch (action.type) {
        case GetTaskType:
          return action.payload;
        default:
          return state;
      }

    
  };
